import React, {Component} from "react";

class Status extends Component {

    state = {
        "o2a_variables": {

            "XFRAStatus": "Online",
            "T7Status": "Online",
            "GmcVersion": "081.390.000",
            "bunny_XFRA": "081.003.090",
        }
    }

    render() {
      return (
          <div>
              <h1> T7 STD: {this.state.o2a_variables.T7Status} </h1>
             <span><h4>BE: {this.state.o2a_variables.bunny_XFRA}</h4> <h4>GMC: {this.state.o2a_variables.GmcVersion}</h4><h4>Bunny: {this.state.o2a_variables.GmcVersion}</h4></span>
          </div>
      )
    }
}
